CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_agences_cheflieux` ()   BEGIN
    DECLARE done INT DEFAULT 0;
    DECLARE v_nom_commune VARCHAR(255);
    DECLARE v_code_dept VARCHAR(3);
    DECLARE v_id_ville INT;
    DECLARE v_code_postal VARCHAR(10);

    DECLARE cur CURSOR FOR
        SELECT nom_commune, code_dept FROM cheflieu;

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    OPEN cur;

    read_loop: LOOP
        FETCH cur INTO v_nom_commune, v_code_dept;
        IF done THEN
            LEAVE read_loop;
        END IF;

        -- Récupérer id_ville et code_postal
        SELECT v.id_ville, vf.ville_code_postal
        INTO v_id_ville, v_code_postal
        FROM ville v
        JOIN ville_france vf ON v.nom_ville = vf.ville_nom_reel
        WHERE vf.ville_nom_reel = v_nom_commune AND vf.ville_departement = v_code_dept
        LIMIT 1;

        -- Insérer l'agence
        VALUES (v_code_postal, v_id_ville);

    END LOOP;

    CLOSE cur;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_villes_from_ville_france` ()   BEGIN
    DECLARE done INT DEFAULT 0;
    DECLARE v_nom_commune VARCHAR(255);
    DECLARE v_code_dept VARCHAR(3);
    DECLARE v_id_region INT;

    -- Curseur sur la table ville_france
    DECLARE cur CURSOR FOR
        SELECT ville_nom_reel, ville_departement FROM villes_france_free;

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    OPEN cur;

    read_loop: LOOP
        FETCH cur INTO v_nom_commune, v_code_dept;
        IF done THEN
            LEAVE read_loop;
        END IF;

        -- Chercher l'id_region correspondant au code_dept
        SELECT id_region INTO v_id_region
        FROM departement
        WHERE code_dept = v_code_dept;

        -- Insérer la commune dans la table ville
        VALUES (v_nom_commune, v_id_region);

    END LOOP;

    CLOSE cur;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `rapports_par_gaz` (IN `gaz_nom` VARCHAR(50))   BEGIN
    SELECT r.ref_rapport, r.date_rapport, d.mesure
    FROM rapport r
    JOIN donnee d ON r.id_rapport = d.id_rapport
    JOIN capteur c ON d.id_capteur = c.id_capteur
    JOIN gaz g ON c.id_gaz = g.id_gaz
    WHERE g.nom_gaz = gaz_nom 
    AND d.mesure IS NOT NULL
    AND d.mesure != 0
    ORDER BY r.date_rapport DESC;
END$$

